        <Paper style={{
                        minWidth:"200px", 
                        minHeight:"100px", 
                        padding:"10px", 
                        margin:"20px",
                        display:"inline-flex"
                        }}>
                <div>
                    <h1>{title}</h1>
                    <p>{content}</p>
                </div>
                <Button onClickstyle={{marginLeft: "120px"}}>
                    <DeleteIcon style={{color: "red"}}/>
                </Button>
        </Paper>
    )
}

export default Note
